import {Routes, Route} from 'react-router-dom';
import SignUp from './Components/Signup.js'; 
import Login from './Components/Login.js';

function App() {
  return (
      <Routes>
        <Route path="/signup" element={<SignUp />} />
        <Route path="/Login" element={<Login />} />
      </Routes>
  );
}

export default App;
